export default  function getAddressByCoordinates(geocoder:google.maps.Geocoder|null, position:any){
    
    if (geocoder) {
        geocoder.geocode({ location: {lat:position.lat,lng:position.lng} }, (results:any, status:any) => {
          if (status === 'OK') {
            // console.log(results)
            if (results![0]) {
                // console.log(results![0].formatted_address);
              return results![0].formatted_address;
              
            } else { console.log('Address not found');
              return 'Address not found'
             
            }
          } else { console.log('Geocoder failed due to: ' + status);
